import React from "react";

import {
  RadioGroup,
  FormControl,
  FormLabel,
  Button,
  Radio,
  Sheet,
  Box,
} from "@mui/joy";

import { theme } from "../../utils/mui-theme";

function pageOne() {
  return (
    <FormControl>
      <RadioGroup
        aria-labelledby="storage-label"
        defaultValue="512GB"
        size="lg"
        sx={{ gap: 1.5 }}
      >

      </RadioGroup>
    </FormControl>
  );
}

export default pageOne;
